    true,nt"url": null,nt"notes": "U.S. Geological Survey, Department of the
    Interior - The annual National Hydrography Dataset (NHD) stewardship plan is to
    maintain hydrography data in the NHD over the United States and its territories.
    NHD for the nation has been collected and is now in maintenance mode. Interested
    parties who wish to become a NHD stewardship partner with the USGS in FY17 or in
    future years should contact a USGS Geospatial Liaison - http://liaisons.usgs.gov/geospatial/documents/TNM_Partnership_User_ContactList.pdf.
    To find out more about hydrography stewardship go to http://nhd.usgs.gov/stewardship.html
